import React, { useState, useEffect } from 'react';
// import { Link } from 'react-router-dom';
import axios from "axios";
import { Button, Container, MainHeading, Section, Heading, TextWrapper, Row, Column } from './../../GlobalStyle';
// import Photo from "./../Photo/Photo";

function Body(){
    const [photos,setPhotos] = useState([]),
        [loading, setLoading] = useState(false),
        [page, setPage] = useState(1),
        [totalPage, SetTotalPage] = useState(0)

    useEffect(() => {
        const getPhotos = async (search) => {
            setLoading(true);
            try {
                const pho = await axios.get(
                    "http://localhost:8000/all-photo"
                    // search === "" ? 'http://localhost:8000/all-photo' : `http://localhost:8000/search/${search}`
                );
                console.log(pho.data.result, "ALL Photo")
                let response = pho.data.result

                response.map((el, error) => {
                        let obj = {}
                        obj.title = el.title
                        obj.
                        axios.get(`http://farm${el.farm}.staticflickr.com/${el.server}/${el.id}_${el.secret}.jpg`).then((response) =>{
                            console.log(response, "response")
                        }).catch((error))
                    })

                setPhotos(pho.data.result)
            } catch (error) {
                console.log("ini error: ", error);
            }
        }
        getPhotos()
    })
    
       // {
            //     id: '52002340535',
            //     owner: '195346136@N04',
            //     secret: 'ec9ef35e47',
            //     server: '65535',
            //     farm: 66,
            //     title: 'New Telegram post by Trusted sources that provide information about war in Ukraine - Достовірна інформація про війну в Україні (Ukraine Media Center)',
            //     ispublic: 1,
            //     isfriend: 0,
            //     isfamily: 0
            //   }

    return(
        <>
            <Container>
                <Section>
                {photos.map(el => (
                    <Row padding="10px">
                        <TextWrapper color="white" font-size="12px">{el.title}</TextWrapper>
                    </Row>
                ))}
                </Section>
            </Container>
        </>
    )
}

export default Body;
